import React from 'react'
import Title from './Title'
import Styled from 'styled-components'


const Landing = () => {
  return (
    <div className='bg-netflix w-full h-screen'>
        <StyledTitle/>
    </div>
  )
}

export default Landing

const StyledTitle = Styled(Title)`
    width: 20%;
    top: 30%;
    left: 15%;
    transform: translate(-15%,-30%);
    position: absolute;
`
